Date.prototype.subtract=function(t,e){if(t instanceof Date==!1)throw Error("Date.subtract: Incorrect parameter specified.");var r=this-t;switch(e){case"y":return this.getFullYear()-t.getFullYear();case"q":Math.floor(this.subtract(t,"m")/4);case"m":12*this.subtract(t,"y")+this.getMonth()-t.getMonth();case"w":return Math.floor(r/6048e5);case"d":return Math.floor(r/864e5);case"h":return Math.floor(r/36e5);case"n":return Math.floor(r/6e4);case"s":return Math.floor(r/1e3);case"ms":return r}},Date.prototype.getWeek=function(){var t=new Date(this.getFullYear(),0,1);return this.subtract(t,"w")},Date.prototype.getDayOfYear=function(){var t=new Date(this.getFullYear(),0,1);return this.subtract(t,"d")},Date.prototype.getQuarter=function(){var t=new Date(this.getFullYear(),0,1);return this.subtract(t,"q")+1},Date.prototype.getDaysInMonth=function(){var t=new Date(this.getFullYear(),this.getMonth(),1);return t.setDate(32),32-t.getDate()};